import EuroIcon from "./components/icons/euro";
import Input from "./components/input";
import StepsInfo from "./components/steps-info";
import { useState } from "react";
function App() {
  const [step, setStep] = useState(0);

  return (
    <div className="flex justify-center border-red-500">
      <div className="flex-1 p-2">
        <div className="flex justify-between">
          <h2>Eligible Wages</h2>
          <StepsInfo
            currentStep={step}
            handleStepChange={(newStep) => setStep(newStep)}
          />
        </div>
      </div>
    </div>
  );
}

export default App;
